import React, { useState } from "react";
import Navbar from "./Navbar";
import "./Apartaments.css";
import flat from "../images/flat.jpg";
import axios from "axios";

const Aparaments = () => {
  const [apartamets, setApartaments] = useState();
  const getApartaments = () => {
    const config = {
      headers: {
        "Content-Type": "application/json",
      },
    };

    axios
      .get("http://127.0.0.1:8000/apartament", config)
      .then(function (response) {
        // handle success
        setApartaments(response.data.apartaments);
        console.log(response.data.apartaments);
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .then(function () {
        // always executed
      });
  };
  getApartaments();

  return (
    <div className="container">
      <Navbar></Navbar>
      <div className="apartaments_list">
        <div className="apartament">
          <img src={flat} alt="Logo" className="apartament_photo" />
          {apartamets.map((apartament) => {
            return (
              <div className="apartament_info">
                <h2>Warszawa Bielany, mieszkanie 2-pokojowe. </h2>
                <h3>Dzielnica: Bielany</h3>
                <h3>Cena: 450 000zł </h3>
                <h3>Cena za metr: 12 000zł </h3>
                <h3>Powierzchnia: 55m2 </h3>
                <h3>Portal: otodom.pl </h3>
              </div>
            );
          })}
        </div>
        <div className="apartament"></div>
      </div>
    </div>
  );
};

export default Aparaments;
